import React, { useState} from 'react';
function App(){
	let [Name,setName]=useState('');

	function Change(e){
		console.log(e.target.value);
		setName(e.target.value);
		
	}
	
	
	
	
	
	return(
		<>
			<h1>hey, {Name}</h1>
			<input type="text" placeholder='enter your name' onChange={Change}/>
			<button>click me</button>
		</>
	)
	
}

export default App;
